import { Switch } from 'react-router';
import ActionTypes from '../types/action.types';

const initialState = {
    products: [
        {
            id: 1,
            name: "shirt",
            category: "clothes",
            amount: 40,
        }
    ]
};

export const productReducer = (state = initialState, {type, payload}) => {

  switch (type) {
      case ActionTypes.SET_PRODUCTS:
          return state
        
    default:
        return  state;
  }
}
